import React, { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";

function Navbar() {

  const nav = useRef();
  const showNavbar = () => {
    nav.current.classList.toggle("responsive_nav");
  };
  return (
    <div>
      <div className="container" id="container">
        
        <img
          ref={nav}
          className="doglogo push"
          src="/doglogo.png"
          alt="logo"
        ></img>
        <nav className="responsive_">
          <button className="loginn">Login</button>
          <button className="signupp">Sign Up</button>
        </nav>
   
        <button className="hamburger_menu" onClick={showNavbar}>
          <FaBars />
        </button>
      </div>
    </div>
  );
}

export default Navbar;
